import React, {useEffect} from 'react';
import './App.css';
import {useDispatch} from 'react-redux';
import {NoteLine} from './NoteLine';
import {loadLine} from './LineActions'

const dispatch = useDispatch();

useEffect(() =>{
  dispatch(loadLine(<NoteLine key={1} noteLine={{id: 1,lineContents:"placeholder text of somesort"}}/>))
},[dispatch]);


function App() {
  return (
    <div className="App">

      <div className="header">
        <div className="title"> Note-Tex </div>
      </div>

      <div className="middle">

        <div className="leftMargin">
          placeholder
        </div>

        <div className="body">

        </div>

        <div className="rightMargin">
          placeholder
        </div>

      </div>

    </div>
  );
}

export default App;
